// src/App.tsx
import React from 'react';
import './App.css';
import ChatInterface from './ChatInterface';

const App: React.FC = () => {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Electrical AI Dashboard</h1>
      </header>
      <main>
        <ChatInterface />
      </main>
    </div>
  );
};

export default App;
